description:
Información de la Aptitud Física Constructiva (AFC), Conflictos de Uso (CU), Capacidad de Acogida (CA) y Conflictos de Uso (CU), así como las Fichas Paisajísticas, derivadas de la aplicación de modelos expertos-heurísticos, que categorizan unidades o espacios homogéneos que determinan la compatibilidad e incompatibilidad constructiva de la Ciudad de Ambato.

Este Conjunto de Datos comprende los siguientes datos:

afc_2019_provisional:v_aptitud_fisica_constructiva_ambato_a;
afc_2019_provisional:v_capacidad_acogida_ambato_a;
afc_2019_provisional:v_conflictos_uso_consolidado_ambato_a;
afc_2019_provisional:v_conflictos_uso_expansion_ambato_a;
f_paisaje:f_paisajistica_ambato_p

Para acceder al Servicio WMS, copie el URL y péguela en su Sistema de Información Geográfica/CAD o en su Visor Geográfico.

Para descargar en formato SHP, ubicar la ciudad de Ambato en la página de descargas.

